import { Button, TextField, Dialog, DialogActions, DialogContent, 
    DialogTitle} from '@material-ui/core';

import React from 'react';

type Props = {
    openCreateAccount: boolean;
    handleCloseCreateAccount: () => void;
}

const CreateAccount: React.FC<Props> = ({openCreateAccount, handleCloseCreateAccount}: Props) => {
    return (
        <Dialog open={openCreateAccount} onClose={handleCloseCreateAccount} fullWidth>
            <DialogTitle>What's on your mind?</DialogTitle>
            <DialogContent>
                <TextField
                    autoFocus
                    type='text'
                    margin="normal"
                    label="Username"
                    fullWidth
                    variant="outlined"
                />
                <TextField
                    type='text'
                    margin="normal"
                    label="Password"
                    fullWidth
                    variant="outlined"
                />
            </DialogContent>
            <DialogActions>
            <Button onClick={handleCloseCreateAccount}>Cancel</Button>
            <Button onClick={handleCloseCreateAccount}>Create Account</Button>
            </DialogActions>
        </Dialog>
    );
};

export default CreateAccount;
